# Mapping from LaTeX math symbol to the corresponding Unicode codepoint.
# This is used for tab substitution in the REPL.

# Most of the entries in latex_symbols are generated by the following Julia script:
#=
latex_symbols = Dict{String,(String,String)}()

#Add symbols from W3C symbol mapping file
using LightXML
isfile("unicode.xml") || download("http://www.w3.org/Math/characters/unicode.xml", "unicode.xml")
for c in child_nodes(root(parse_file("unicode.xml")))
    if name(c) == "character" && is_elementnode(c)
        ce = XMLElement(c)
        latex = nothing
        for el in ("AMS", "IEEE", "mathlatex", "latex")
            latex = find_element(ce, el)
            latex != nothing && break
        end
        if latex != nothing
            latexcmd = strip(content(latex))
            id = attribute(ce, "id")
            unichar = string(map(s -> char(parseint(s, 16)),
                           split(id[2:end], "-"))...)
            if ismatch(r"^\\[A-Za-z]+$",latexcmd) && !isa(unichar, ASCIIString)
                if latexcmd in keys(latex_symbols)
                    warn("# duplicated symbol $latexcmd ($id)")
                else
                    latex_symbols[unichar] = (latexcmd, "")
                end
            end
        end
    end
end

# Add more symbols from the unicode-math LaTeX package
isfile("unicode-math-table.tex") || download("http://mirror.math.ku.edu/tex-archive/macros/latex/contrib/unicode-math/unicode-math-table.tex", "unicode-math-table.tex")
open("unicode-math-table.tex") do f
    for line in eachline(f)
        x = map(s -> rstrip(s, [' ','\t','\n']),
                split(replace(line, r"[{}\"]+", "\t"), "\t"))
        c = char(parseint(x[2], 16))
        isascii(c) || x[3] in values(latex_symbols) || c in keys(latex_symbols) || (latex_symbols[string(c)] = (x[3], x[5]))
    end
end

#Write list
for (unichar, (latexcmd, id)) in sort!([x for x in latex_symbols])
    print("    \"$(escape_string(latexcmd))\" => \"$(escape_string(unichar))\",")
    id == "" || print(" # ", id)
    println()
end
